import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Attempt XSS via search input
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', '<script>alert("XSS")</script>');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_input.png'));

    await page.click('.search-btn');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_clicked_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_clicked_search.png'));

    return {
      success: true,
      action: "Attempted XSS via search input",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
